import React, { useState, useEffect } from 'react'

const AttributeButton = ({ id, icon, filter, setAttribute }) => {

    const [ selected, setSelected ] = useState(true);

    return (
        <div className={`attribute_button ${selected?`selected`:``}`} id={id} onClick={() => {setSelected(!selected); setAttribute(selected, filter); }}>
            <img src={icon} />
        </div>
    )
}

export default AttributeButton
